import React from 'react'

const PriceTag = () => {
    return (
        <div className="App">
            <h1>Пример ценника</h1>
            <div className="page">
                {[...Array(8)].map((_, index) => (
                    <PriceTag
                        key={index}
                        productName={`Продукт ${index + 1}`}
                        description="Описание продукта"
                        price={(index + 1) * 100 + ".00"}
                    />
                ))}
            </div>
        </div>
    )
}

export default PriceTag
